import React, { useMemo } from "react";
import Slider from "react-slick";
import Carou from "./carou";
import videos from "./videos";

const Carousel = () => {
  const numSlides = videos.length;

  const settings = useMemo(
    () => ({
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 2,
      slidesToScroll: 1,
      centerMode: true,
      centerPadding: "0",
      dotsClass: "slick-dots w-auto bottom-0 mb-8",
      customPaging: (i) => (
        <button className="text-white opacity-50 focus:outline-none focus:opacity-100">
          {i + 1}
        </button>
      ),
    }),
    []
  );

  return (
    <Slider {...settings}>
      {videos.map((video, index) => (
        <Carou key={video.id} index={index} />
      ))}
    </Slider>
  );
};

export default Carousel;
